// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.8.2 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Storage {

    uint256 number;

    string texto = unicode"Hello Word";

    /**
     * @dev Store value in variable
     * @param num value to store
     */
    function store(uint256 num) public {
        number = num;
    }

    /**
     * @dev Return value 
     * @return value of 'number'
     */
    function retrieve() public view returns (uint256){
        return number;
    }

    /**
     * memory - em tempo de execucao
     * calldata - sÃ³ para leitura
     * storage - armazena
     */
    function retornarPure() public pure returns (string memory) {
        return unicode"Hello Word";
    }

    function retornarView() public view returns (string memory) {
        return texto;
    }
}

